import React from "react";

import { ChakraProvider, extendTheme, DefaultTheme } from '@chakra-ui/react';
import { customTheme } from '../../styles/theme';

export default function App() {

  return (
    <ChakraProvider theme={customTheme}>
      <h1>Teste</h1>
    </ChakraProvider>
  );
}
